import React, { useState, useEffect } from 'react';
import { BarChart, TrendingUp, Users, Eye, MousePointer, Clock, PartyPopper, X } from 'lucide-react';
import { Card } from '../../components/Card';
import { Badge } from '../../components/Badge';
import { Button } from '../../components/Button';
import { Checkbox } from '../../components/Checkbox';
import { InfoBox } from '../../components/InfoBox';

interface Step4Props {
  onComplete: () => void;
  appData: {
    appId: string;
    dataUrl: string;
    selectedVersion: 'saas' | 'private' | null;
  };
}

export const Step4AnalyticsStart: React.FC<Step4Props> = ({
  onComplete,
  appData
}) => {
  const [understood, setUnderstood] = useState(false);
  const [celebrationShown, setCelebrationShown] = useState(false);
  const [hasCompleted, setHasCompleted] = useState(false);

  // 게이밍 테마
  const theme = {
    text: '#ffffff',
    textSecondary: '#a1a1aa'
  };

  useEffect(() => {
    if (understood && !hasCompleted) {
      onComplete();
      setCelebrationShown(true);
      setHasCompleted(true);
    }
  }, [understood, hasCompleted, onComplete]);

  const dashboardSteps = [
    {
      step: 1,
      title: '대시보드 템플릿 선택',
      description: '사전 구성된 템플릿 중 하나를 선택하거나 빈 대시보드로 시작하세요.',
      icon: <BarChart size={20} color="#334155" />
    },
    {
      step: 2,
      title: '기본 차트 추가',
      description: '사용자 수, 페이지 뷰, 이벤트 추적 등 기본 차트를 추가하세요.',
      icon: <TrendingUp size={20} color="var(--success)" />
    },
    {
      step: 3,
      title: '필터 및 기간 설정',
      description: '분석하고 싶은 기간과 조건을 설정하세요.',
      icon: <Clock size={20} color="var(--warning)" />
    },
    {
      step: 4,
      title: '대시보드 공유',
      description: '완성된 대시보드를 팀원들과 공유하세요.',
      icon: <Users size={20} color="var(--info)" />
    }
  ];

  const recommendedMetrics = [
    {
      category: '사용자 분석',
      icon: <Users size={24} color="#334155" />,
      metrics: [
        { name: 'DAU (일일 활성 사용자)', description: '하루 동안 앱을 사용한 고유 사용자 수' },
        { name: 'MAU (월간 활성 사용자)', description: '한 달 동안 앱을 사용한 고유 사용자 수' },
        { name: '신규 사용자', description: '처음으로 앱을 사용하는 사용자 수' },
        { name: '재방문 사용자', description: '이전에 앱을 사용한 적이 있는 사용자 수' }
      ]
    },
    {
      category: '참여도 분석',
      icon: <MousePointer size={24} color="var(--success)" />,
      metrics: [
        { name: '페이지 뷰', description: '각 페이지가 조회된 총 횟수' },
        { name: '세션 수', description: '사용자가 앱을 사용한 세션의 총 개수' },
        { name: '평균 세션 시간', description: '사용자가 한 번의 세션에서 머무는 평균 시간' },
        { name: '바운스율', description: '한 페이지만 보고 떠나는 사용자의 비율' }
      ]
    },
    {
      category: '행동 분석',
      icon: <Eye size={24} color="var(--warning)" />,
      metrics: [
        { name: '클릭률', description: '특정 요소가 클릭되는 비율' },
        { name: '전환율', description: '목표 행동을 완료하는 사용자의 비율' },
        { name: '퍼널 분석', description: '사용자가 특정 과정을 완료하는 단계별 분석' },
        { name: '히트맵', description: '사용자가 가장 많이 상호작용하는 영역 시각화' }
      ]
    }
  ];

  return (
    <div style={{ color: theme.text }}>
      {/* 게이밍 스타일 Step Title */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{
          display: 'flex',
          alignItems: 'center',
          gap: '16px',
          marginBottom: '20px',
          padding: '20px',
          background: 'rgba(139, 92, 246, 0.1)',
          borderRadius: '16px',
          border: '1px solid rgba(139, 92, 246, 0.3)',
          position: 'relative',
          overflow: 'hidden'
        }}>
          {/* 배경 장식 */}
          <div style={{
            position: 'absolute',
            top: '-50%',
            right: '-20%',
            width: '100px',
            height: '100px',
            background: 'linear-gradient(135deg, rgba(139, 92, 246, 0.1), rgba(59, 130, 246, 0.1))',
            borderRadius: '50%',
            filter: 'blur(30px)'
          }} />

          <div style={{
            width: '60px',
            height: '60px',
            background: 'linear-gradient(135deg, #8b5cf6, #3b82f6)',
            borderRadius: '18px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            boxShadow: '0 8px 20px rgba(139, 92, 246, 0.4)',
            position: 'relative',
            zIndex: 1
          }}>
            <BarChart size={28} color="white" />
          </div>
          <div style={{ position: 'relative', zIndex: 1 }}>
            <h3 style={{
              fontSize: '28px',
              fontWeight: '800',
              background: 'linear-gradient(135deg, #8b5cf6, #3b82f6)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              margin: 0,
              marginBottom: '8px'
            }}>
              미션 4: 분석 시작 🚀
            </h3>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '12px'
            }}>
              <span style={{
                fontSize: '14px',
                color: theme.textSecondary,
                padding: '4px 12px',
                background: 'rgba(139, 92, 246, 0.2)',
                borderRadius: '12px',
                fontWeight: '600'
              }}>
                레벨: 고급자
              </span>
              <span style={{
                fontSize: '14px',
                color: '#f59e0b',
                display: 'flex',
                alignItems: 'center',
                gap: '4px'
              }}>
                <Star size={16} />
                보상: +150 XP
              </span>
            </div>
          </div>
        </div>
        <p style={{
          fontSize: '18px',
          color: theme.textSecondary,
          lineHeight: '1.6',
          margin: 0,
          padding: '0 20px'
        }}>
          🎯 <strong>목표:</strong> 데이터 분석의 마스터가 되어 강력한 인사이트를 발견하세요!
        </p>
      </div>

      {/* 게이밍 스타일 Configuration Summary */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{
          padding: '24px',
          background: 'linear-gradient(145deg, rgba(30, 30, 60, 0.9), rgba(15, 15, 35, 0.9))',
          border: '1px solid rgba(139, 92, 246, 0.3)',
          borderRadius: '20px',
          boxShadow: '0 8px 24px rgba(0, 0, 0, 0.2)',
          backdropFilter: 'blur(20px)',
          position: 'relative',
          overflow: 'hidden'
        }}>
          {/* 배경 장식 */}
          <div style={{
            position: 'absolute',
            top: '-30%',
            left: '-20%',
            width: '150px',
            height: '150px',
            background: 'linear-gradient(135deg, rgba(16, 185, 129, 0.1), rgba(5, 150, 105, 0.1))',
            borderRadius: '50%',
            filter: 'blur(40px)'
          }} />

          <div style={{
            display: 'flex',
            alignItems: 'center',
            gap: '16px',
            marginBottom: '20px',
            position: 'relative',
            zIndex: 1
          }}>
            <div style={{
              width: '48px',
              height: '48px',
              background: 'linear-gradient(135deg, #10b981, #059669)',
              borderRadius: '16px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              boxShadow: '0 8px 20px rgba(16, 185, 129, 0.4)'
            }}>
              <Trophy size={24} color="white" />
            </div>
            <h4 style={{ 
              fontSize: '24px', 
              fontWeight: '700', 
              margin: 0,
              background: 'linear-gradient(135deg, #10b981, #059669)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}>
              🏆 설정 완료된 구성 - 퀘스트 달성!
            </h4>
          </div>

