            display: 'grid', 
            gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', 
            gap: '16px',
            marginBottom: '20px',
            position: 'relative',
            zIndex: 1
          }}>
            <div style={{ 
              padding: '16px', 
              background: 'rgba(139, 92, 246, 0.1)',
              boxShadow: '0 4px 15px rgba(139, 92, 246, 0.2)', 
              borderRadius: '16px',
              border: '1px solid rgba(139, 92, 246, 0.3)',
              backdropFilter: 'blur(10px)'
            }}>
              <div style={{ fontSize: '12px', color: theme.textSecondary, marginBottom: '8px', fontWeight: '600' }}>🎮 버전</div>
              <div style={{ fontSize: '16px', fontWeight: '700', color: theme.text }}>
                {appData.selectedVersion === 'saas' ? '☁️ SaaS 버전' : 
                 appData.selectedVersion === 'private' ? '🏰 프라이빗 버전' : '❌ 미선택'}
              </div>
            </div>
            <div style={{ 
              padding: '16px', 
              background: 'rgba(59, 130, 246, 0.1)',
              boxShadow: '0 4px 15px rgba(59, 130, 246, 0.2)', 
              borderRadius: '16px',
              border: '1px solid rgba(59, 130, 246, 0.3)',
              backdropFilter: 'blur(10px)'
            }}>
              <div style={{ fontSize: '12px', color: theme.textSecondary, marginBottom: '8px', fontWeight: '600' }}>🆔 App ID</div>
              <div style={{ fontSize: '16px', fontWeight: '700', color: theme.text }}>
                {appData.appId || '⚠️ 미입력'}
              </div>
            </div>
            <div style={{ 
              padding: '16px', 
              background: 'rgba(16, 185, 129, 0.1)',
              boxShadow: '0 4px 15px rgba(16, 185, 129, 0.2)', 
              borderRadius: '16px',
              border: '1px solid rgba(16, 185, 129, 0.3)',
              backdropFilter: 'blur(10px)'
            }}>
              <div style={{ fontSize: '12px', color: theme.textSecondary, marginBottom: '8px', fontWeight: '600' }}>🌐 Data URL</div>
              <div style={{ 
                fontSize: '14px', 
                fontWeight: '600', 
                color: theme.text,
                wordBreak: 'break-all'
              }}>
                {appData.dataUrl || '⚠️ 미입력'}
