            </div>
          </div>

          <div style={{
            padding: '20px',
            background: 'rgba(16, 185, 129, 0.1)',
            borderRadius: '16px',
            border: '1px solid rgba(16, 185, 129, 0.3)',
            position: 'relative',
            zIndex: 1
          }}>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '12px',
              marginBottom: '12px'
            }}>
              <div style={{
                width: '32px',
                height: '32px',
                background: 'linear-gradient(135deg, #10b981, #059669)',
                borderRadius: '50%',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}>
                <Trophy size={16} color="white" />
              </div>
              <h5 style={{
                fontSize: '18px',
                fontWeight: '700',
                margin: 0,
                color: '#10b981'
              }}>
                ✅ 설정 완료! 미션 달성!
              </h5>
            </div>
            <p style={{ 
              margin: 0, 
              color: theme.text,
              lineHeight: '1.5',
              fontSize: '15px'
            }}>
              🎉 모든 기본 설정이 완료되었습니다! 이제 데이터가 수집되기 시작하면 
              실시간으로 분석 결과를 확인할 수 있습니다.
            </p>
          </div>
        </div>
      </div>

      {/* Dashboard Creation Steps */}
      <div style={{ marginBottom: '32px' }}>
        <Card>
          <h4 style={{ 
            fontSize: '18px', 
            fontWeight: '600', 
            marginBottom: '16px',
            color: 'var(--gray-900)'
          }}>
            첫 번째 대시보드 생성하기
          </h4>

          <div style={{ 
            display: 'flex', 
            flexDirection: 'column', 
            gap: '16px' 
          }}>
            {dashboardSteps.map((step, index) => (
              <div key={step.step} style={{ 
                display: 'flex', 
                alignItems: 'flex-start', 
                gap: '16px',
                padding: '16px',
                background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)',
                borderRadius: 'var(--border-radius)',
                border: '1px solid var(--gray-200)'
              }}>
                <div style={{
                  width: '40px',
                  height: '40px',
                  borderRadius: 'var(--border-radius)',
                  backgroundColor: 'var(--white)',
                  border: '1px solid var(--gray-200)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  flexShrink: 0
                }}>
                  {step.icon}
                </div>
                <div style={{ flex: 1 }}>
                  <h5 style={{ 
                    fontSize: '16px', 
                    fontWeight: '600', 
                    margin: '0 0 8px 0',
                    color: 'var(--gray-900)'
                  }}>
                    {step.step}. {step.title}
                  </h5>
                  <p style={{ 
                    fontSize: '14px', 
                    color: 'var(--gray-600)', 
                    margin: 0,
                    lineHeight: '1.5'
                  }}>
                    {step.description}
                  </p>
                </div>
              </div>
            ))}
          </div>

        </Card>
      </div>

      {/* Recommended Metrics */}
      <div style={{ marginBottom: '32px' }}>
        <h4 style={{ 
          fontSize: '18px', 
          fontWeight: '600', 
          marginBottom: '16px',
          color: 'var(--gray-900)'
        }}>
          추천 분석 지표
        </h4>

        <div style={{ 
          display: 'grid', 
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
          gap: '24px' 
        }}>
          {recommendedMetrics.map((category, categoryIndex) => (
            <Card key={categoryIndex}>
              <div style={{ 
                display: 'flex', 
                alignItems: 'center', 
                gap: '12px',
                marginBottom: '16px'
              }}>
                {category.icon}
                <h5 style={{ 
                  fontSize: '16px', 
                  fontWeight: '600', 
                  margin: 0,
                  color: 'var(--gray-900)'
                }}>
                  {category.category}
                </h5>
              </div>

              <div style={{ 
                display: 'flex', 
                flexDirection: 'column', 
                gap: '12px' 
              }}>
                {category.metrics.map((metric, metricIndex) => (
                  <div key={metricIndex} style={{ 
                    padding: '12px',
                    background: 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)',
                    borderRadius: 'var(--border-radius)',
                    border: '1px solid var(--gray-200)'
                  }}>
                    <div style={{ 
                      fontSize: '14px', 
                      fontWeight: '600', 
                      color: 'var(--gray-900)',
                      marginBottom: '4px'
                    }}>
                      {metric.name}
                    </div>
                    <div style={{ 
                      fontSize: '12px', 
                      color: 'var(--gray-600)',
                      lineHeight: '1.4'
                    }}>
                      {metric.description}
                    </div>
                  </div>
                ))}
              </div>
            </Card>
          ))}
        </div>
      </div>

      {/* Next Steps */}
      <div style={{ marginBottom: '32px' }}>
        <InfoBox type="info" title="다음 단계 안내">
          <div style={{ 
            display: 'flex', 
            flexDirection: 'column', 
            gap: '8px',
            fontSize: '14px'
          }}>
            <p style={{ margin: '0 0 8px 0' }}>분석을 시작한 후 다음과 같은 기능들을 활용해보세요:</p>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>커스텀 이벤트 추가 및 사용자 세그먼트 생성</span>
            </div>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>A/B 테스트 및 퍼널 분석 설정</span>
            </div>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <Badge variant="info" size="sm">고급</Badge>
              <span>알림 및 자동 리포트 설정</span>
            </div>
          </div>
        </InfoBox>
      </div>

      {/* Completion */}
      <div style={{ 
        padding: '20px', 
        background: 'linear-gradient(135deg, #f8f9fa 0%, #e9ecef 100%)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)', 
        borderRadius: 'var(--border-radius)',
        border: '1px solid var(--gray-200)'
      }}>
        <Checkbox
          checked={understood}
          onChange={setUnderstood}
          label="분석 시작 단계를 이해했으며, Thinking Engine 설정이 모두 완료되었습니다."
        />
      </div>

      {/* Celebration Modal */}
      {celebrationShown && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: 'rgba(0, 0, 0, 0.5)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          zIndex: 1000
        }}>
          <div style={{
            backgroundColor: 'white',
            padding: '40px',
            borderRadius: 'var(--border-radius-lg)',
            maxWidth: '500px',
            margin: '20px',
            textAlign: 'center',
            boxShadow: 'var(--shadow-xl)',
            position: 'relative'
          }}>
            <button
              onClick={() => setCelebrationShown(false)}
              style={{
                position: 'absolute',
                top: '16px',
                right: '16px',
                background: 'none',
                border: 'none',
                cursor: 'pointer',
                padding: '4px',
                borderRadius: '4px',
                color: 'var(--gray-400)',
                fontSize: '0'
              }}
            >
              <X size={20} />
            </button>
            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              marginBottom: '20px' 
            }}>
              <PartyPopper size={64} color="var(--success)" />
            </div>
            <h4 style={{ 
              fontSize: '28px', 
              fontWeight: '600', 
              margin: '0 0 16px 0',
              color: 'var(--gray-900)'
            }}>
              축하합니다! 🎉
            </h4>
            <p style={{ 
              fontSize: '16px', 
              margin: '0 0 32px 0',
              lineHeight: '1.6',
              color: 'var(--gray-600)'
            }}>
              Thinking Engine의 빠른 시작 가이드를 모두 완료했습니다.<br/>
              이제 강력한 데이터 분석의 세계를 탐험해보세요!
            </p>
            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: '12px',
              flexWrap: 'wrap'
            }}>
              <Button 
                variant="outline"
                onClick={() => window.open('https://www.thinkingdata.kr/', '_blank')}
              >
                🏠 홈으로
              </Button>
              <Button 
                variant="primary"
                onClick={() => window.open('https://te-web-naver.thinkingdata.kr/', '_blank')}
              >
                📊 분석 시작하기
              </Button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
